  <title>Government of Pakistan</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: #006400;
      margin: 0;
      padding: 0;
      color: white;
      text-align: center;
    }
    .container {
      margin: 50px auto;
      max-width: 600px;
      background: rgba(0, 0, 0, 0.5);
      padding: 20px;
      border-radius: 10px;
    }
    input[type="text"] {
      padding: 10px;
      font-size: 16px;
      width: 80%;
      margin-bottom: 20px;
    }
    button {
      display: block;
      margin: 10px auto;
      padding: 10px 20px;
      font-size: 16px;
      border: none;
      border-radius: 5px;
      background-color: #00cc44;
      color: white;
      cursor: pointer;
    }
    button:hover {
      background-color: #009933;
    }
    .result {
      margin-top: 20px;
    }
    .hidden {
      display: none;
    }
    img {
      max-width: 100%;
      border-radius: 10px;
      margin-top: 20px;
    }
    .logo {
      max-width: 120px;
      display: block;
      margin: 0 auto 10px auto;
    }
  </style>

 <script>
  function searchCNIC() {
    const cnic = document.getElementById('cnicInput').value.trim();
    const resultDiv = document.getElementById('result');

    if (cnic === '7245861030721') {
      let btn1 = document.createElement('button');

    } else if (cnic === '3410144333123') {
      let btn1 = document.createElement('button');
